  StringBuilder sb = new StringBuilder();
  sb.append(getClass().getSimpleName());
  sb.append("{ ");
  sb.append("path=").append(getPath());
  sb.append("; isDirectory=").append(isDir());
  sb.append("; length=").append(getLen());
  sb.append("; blocksize=").append(getBlockSize());
